- proto: N14ClothingHeadHelmetPowerArmorHellfire
  entities:
  - uid: 182
    components:
    - type: MetaData
      desc: 'Чёрный шлем рейнджера, что был модифицирован для операции «Тёмная Ночь», под командованием старшим паладином "Грим". Цель данной операции - уничтожение беженцев Анклава на аванпосту «Заправочная Станция Альфрус». Итог - Ноль потерь со стороны группы зачистки и двенадцать трупов со стороны противника. Цитата из отчёта: сопротивление они не оказали, среди них было два подростка, что попытались пожертвовать собой. Во время операции, был получен трофейный винтокрыл, что по сей день служит Братству.'
