        **[head=2]ФИНАЛЬНЫЙ ОТЧЁТ ОФИЦЕРА СВЯЗИ АНКЛАВА. УБЕЖИЩЕ РАДИОСВЯЗИ "ГРОМОВЕРЖЕЦ"[/head]**  


        Дата и время: 17.05.2245, 23:12  

        Составитель: Лейтенант Элиас Грейвс  

        Статус: Последний оператор частоты "Тишина"  


        [bullet] Командование не отвечает. Ни приказов, ни координат, ни даже проклятий в эфире. Только статический вой, да редкие всплески "чего-то", что я уже боюсь называть голосами.  


        [bullet] "Молчаливое радио" живёт своей жизнью. Вчера в 04:33 снова играла "I Don't Want to Set the World on Fire" - чистый сигнал, будто из 2077 года. А позавчера… слышал детский шёпот. Говорил: "Они в проводах".  


        [bullet] ZAX 2.7 "Паладин" не признаёт меня человеком. Последний диалог: "Вы не соответствуете биометрическим шаблонам Анклава. Рекомендую самоуничтожение во избежание компрометации объекта". 



        Если вы это читаете - значит, убежище ещё не поглотила пустота. Не пытайтесь реанимировать ретрансляторы. *Оно* их слушает. Похороните нас с нашивками. Даже если найдёте только кости. Боже, спаси Анклав. Боже, спаси то, что от него осталось.
